import React, { useState } from "react";
import "./css/nav.css";
import { useNavigate } from "react-router-dom";
function Nav() {
  const navigate = useNavigate();
  const [isOpen, setIsOpen] = useState(false);
  const dep=()=>{
    navigate("/deposit");
  }
  const wit=()=>{
    navigate("/withdraw");
  }
  const p = () => {
    setIsOpen(!isOpen);
  };
  const h = () => {
    navigate("/home");
  };
  const u = () => {
    navigate("/um");
  };
  return (
    <div className="nmain">
      <div className="nav">
        <div id="nh1">GAMING HUB</div>
        <div className="hur">
          <button onClick={h}>HOME</button>
          <button className="ur" onClick={u}>
            UPCOMMING MATCHES
          </button>
          <button className="ur">RESULT</button>
        </div>
        <div className="p">
          <button onClick={p}>PROFILE</button>
        </div>
      </div>
      {isOpen && (
        <div className="dw">
          <button onClick={dep}>DEPOSIT</button>
          <button onClick={wit}>WITHDRAW</button>
        </div>
      )}
    </div>
  );
}
export default Nav;
